-- Primary data load based on JSON_TABLE mapping (variation 2)
insert /*+ APPEND */ into dc_masterfile_orig_map_pi (
    id, masterfile_meta_id, orig_field_name, data, document_id, group_id, predicted_key,
    indicative_type, page_num, coordinate_resolution, coordinate_X1, coordinate_Y1,
    coordinate_X2, coordinate_Y2, confidence_key_prediction, confidence_extraction,
    adp_field, adp_value, group_id_copy, project_oid, updated_on, f_to_drop, f_app_generated,
    sequenceNumber
)
select nextgen_sequence.nextval, t.* from (
    select mm.id, jt.orig_field_name, jt.data, jt.document_id, jt.group_id, jt.predicted_key,
           jt.indicativetype, nvl(jt.page_num, 0) page_num,
           jt.coordinate_resolution, jt.coordinate_X1, jt.coordinate_Y1, jt.coordinate_X2, jt.coordinate_Y2,
           jt.confidence_key_prediction, jt.confidence_extraction,
           null as adp_field, null as adp_value, jt.group_id as group_id_copy,
           mm.project_oid, sysdate updated_on, 0 f_to_drop, 0 f_app_generated,
           sequenceNumber
    from dc_masterfile_meta_pi mm,
         json_table(mm.api_original, '$[*]'
           columns (
             orig_field_name path '$[*].value.originalFieldName',
             data path '$[*].value.data',
             document_id path '$[*].documentID',
             group_id path '$[*].value.group',
             predicted_key path '$[*].key',
             indicativetype path '$[*].sectionName',
             page_num path '$[*].value.metadata.pageNumber',
             coordinate_resolution path '$[*].value.metadata.Resolution',
             coordinate_X1 path '$[*].value.metadata.coordinateX1',
             coordinate_Y1 path '$[*].value.metadata.coordinateY1',
             coordinate_X2 path '$[*].value.metadata.coordinateX2',
             coordinate_Y2 path '$[*].value.metadata.coordinateY2',
             confidence_key_prediction path '$[*].value.confidence.keyPrediction',
             confidence_extraction path '$[*].value.confidence.extraction',
             sequenceNumber path '$[*].value.metadata.sequenceNumber'
           )
         ) jt
    where mm.project_oid = p_project_oid
      and mm.competitor_id = p_competitor_id
      and mod(jt.sequenceNumber + 2, 2) = 0
) t;;

GO

