-- Supporting objects to make the changeset "huge"
declare
    v_exists number;
begin
    select count(*) into v_exists from user_tables where table_name = 'TMP_STAGE_99';
    if v_exists = 0 then
        execute immediate 'create table TMP_STAGE_99 (
            id number primary key,
            k varchar2(200),
            v clob,
            created_on date default sysdate
        )';
    end if;
end;
/

create or replace procedure LOAD_TMP_STAGE_99 as
begin
    for i in 1..250 loop
        insert /*+ parallel(4) */ into TMP_STAGE_99(id, k, v)
        values (nextgen_sequence.nextval, 'K'||i, rpad('V'||i, 200, '*'));
    end loop;
    commit;
end;
/

begin
    LOAD_TMP_STAGE_99;
end;
/

create index IDX_TMP_STAGE_99_K on TMP_STAGE_99(k);

GO

GO
-- Post-load compaction and stats
begin
    dbms_stats.gather_table_stats(ownname => user, tabname => 'TMP_STAGE_99', estimate_percent => 5);
end;
/

